import React, { useState, useEffect } from 'react';
import { Camera, Upload, Sparkles, Zap, Target, TrendingUp } from 'lucide-react';

const Home = () => {
  const [isVisible, setIsVisible] = useState(false);
  const [activeFeature, setActiveFeature] = useState(0);

  useEffect(() => {
    setIsVisible(true);
    const interval = setInterval(() => {
      setActiveFeature(prev => (prev + 1) % 3);
    }, 3000);
    return () => clearInterval(interval);
  }, []);

  const features = [
    { icon: <Target className="w-6 h-6" />, text: "Precise AI Measurements" },
    { icon: <Sparkles className="w-6 h-6" />, text: "Smart Style Recommendations" },
    { icon: <TrendingUp className="w-6 h-6" />, text: "Trending Fashion Insights" }
  ];

  return (
    <section className="min-h-screen bg-gradient-to-br from-indigo-50 via-purple-50 to-pink-50 relative overflow-hidden">
      {/* Animated background elements */}
      <div className="absolute inset-0">
        <div className="absolute top-20 left-10 w-32 h-32 bg-purple-200/30 rounded-full blur-xl animate-pulse"></div>
        <div className="absolute top-40 right-20 w-24 h-24 bg-pink-200/40 rounded-full blur-lg animate-bounce"></div>
        <div className="absolute bottom-32 left-20 w-20 h-20 bg-indigo-200/50 rounded-full blur-md animate-pulse delay-1000"></div>
        <div className="absolute bottom-20 right-32 w-28 h-28 bg-purple-300/20 rounded-full blur-xl animate-bounce delay-500"></div>
      </div>

      <div className="relative z-10 flex items-center justify-center min-h-screen px-4 py-12">
        <div className={`transform transition-all duration-1000 ${isVisible ? 'translate-y-0 opacity-100' : 'translate-y-8 opacity-0'}`}>

          {/* Main content card */}
          <div className="bg-white/70 backdrop-blur-xl border border-white/20 p-8 md:p-12 rounded-3xl shadow-2xl max-w-2xl w-full text-center relative">

            {/* Gradient border effect */}
            <div className="absolute inset-0 bg-gradient-to-r from-purple-500 via-pink-500 to-indigo-500 rounded-3xl blur opacity-20 -z-10"></div>

            {/* Header section */}
            <div className="mb-8">
              <div className="flex justify-center mb-4">
                <div className="bg-gradient-to-r from-purple-600 to-pink-600 p-3 rounded-2xl">
                  <Zap className="w-8 h-8 text-white" />
                </div>
              </div>

              <h1 className="text-4xl md:text-6xl font-black bg-gradient-to-r from-purple-700 via-pink-600 to-indigo-700 bg-clip-text text-transparent mb-4 leading-tight">
                AI-Powered
                <br />
                Perfect Fit
              </h1>

              <p className="text-lg md:text-xl text-gray-600 mb-6 leading-relaxed">
                Revolutionary AI technology that analyzes your body measurements and curates 
                <span className="font-semibold text-purple-700"> personalized fashion recommendations</span> 
                tailored just for you.
              </p>
            </div>

            {/* Features showcase */}
            <div className="mb-8">
              <div className="flex justify-center items-center space-x-8 mb-6">
                {features.map((feature, index) => (
                  <div 
                    key={index}
                    className={`flex flex-col items-center transition-all duration-500 ${
                      activeFeature === index 
                        ? 'text-purple-600 scale-110' 
                        : 'text-gray-400 scale-100'
                    }`}
                  >
                    <div className={`p-3 rounded-full mb-2 transition-all duration-500 ${
                      activeFeature === index 
                        ? 'bg-purple-100 shadow-lg' 
                        : 'bg-gray-100'
                    }`}>
                      {feature.icon}
                    </div>
                    <span className="text-xs font-medium hidden md:block">{feature.text}</span>
                  </div>
                ))}
              </div>
            </div>

            {/* Action buttons */}
            <div className="space-y-4">
              <div className="flex flex-col sm:flex-row gap-4 justify-center">

                {/* Camera button */}
                <button className="group bg-gradient-to-r from-purple-600 to-pink-600 text-white px-8 py-4 rounded-2xl font-bold text-lg transition-all duration-300 transform hover:scale-105 hover:shadow-2xl hover:shadow-purple-500/25 flex items-center justify-center space-x-3 min-w-[200px]">
                  <Camera className="w-6 h-6 group-hover:animate-pulse" />
                  <span>Take Photo</span>
                </button>

                {/* Upload button */}
                <button className="group bg-white text-purple-600 border-2 border-purple-200 px-8 py-4 rounded-2xl font-bold text-lg transition-all duration-300 transform hover:scale-105 hover:bg-purple-50 hover:border-purple-300 hover:shadow-xl flex items-center justify-center space-x-3 min-w-[200px]">
                  <Upload className="w-6 h-6 group-hover:animate-bounce" />
                  <span>Upload Image</span>
                </button>
              </div>

              {/* Secondary CTA */}
              <div className="pt-4">
                <a
                  href="/measure"
                  className="inline-flex items-center text-purple-600 hover:text-purple-700 font-semibold transition-colors duration-200 group"
                >
                  <span>Start AI Analysis</span>
                  <Sparkles className="w-4 h-4 ml-2 group-hover:animate-spin" />
                </a>
              </div>
            </div>

            {/* Trust indicators */}
            <div className="mt-8 pt-6 border-t border-gray-200/50">
              <div className="flex justify-center items-center space-x-6 text-sm text-gray-500">
                <div className="flex items-center space-x-1">
                  <div className="w-2 h-2 bg-green-500 rounded-full"></div>
                  <span>99.5% Accuracy</span>
                </div>
                <div className="flex items-center space-x-1">
                  <div className="w-2 h-2 bg-blue-500 rounded-full"></div>
                  <span>2M+ Users</span>
                </div>
                <div className="flex items-center space-x-1">
                  <div className="w-2 h-2 bg-purple-500 rounded-full"></div>
                  <span>AI-Powered</span>
                </div>
              </div>
            </div>
          </div>

          {/* Floating elements */}
          <div className="absolute -top-4 -right-4 bg-gradient-to-r from-yellow-400 to-orange-500 text-white px-4 py-2 rounded-full text-sm font-bold animate-pulse shadow-lg">
            ✨ New AI Model
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
